import React from 'react'
import { Link } from 'react-router-dom'
import './Button.css'
const button = (props) => {
  return (
    <div className='text-center'>
      <button className='button text-align-center align-item-center'>
        <Link to={project}>
          {props.text}
        </Link>
      </button>
    </div>

  )
}

export default button
